import React from 'react';
import { Link } from "react-router-dom";
import '../css/tournaments.css';

const TournamentBlock = () => (
  <div className='block'>
    <div className='left'>
      <p className='date'>Дата проведения</p>
      <p className='organization'>Организатор</p>
    </div>

    <div className='right'>
      <p className='tourName'>НАЗВАНИЕ ТУРНИРА</p>
      <p className='map'>Карта</p>
    </div>
  </div>
);

const Tournaments = () => (
  <div className='tournaments'>
    <TournamentBlock />

    <div className='tournaments-button'>
      <Link to='/ivents'>Показать больше турниров</Link>
    </div>
  </div>
);

export default Tournaments;
